import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux'; // Importez le composant Provider
import store from 'src/redux\Store.jsx'; // Importez le magasin Redux
import App from './App'; // Importez votre composant racine

ReactDOM.render(
  <Provider store={store}> {/* Enveloppez votre application avec le Provider et passez le magasin Redux comme propriété */}
    <App />
  </Provider>,
  document.getElementById('root')
);
